数値から最も近い括弧の数に変換(js)
let tension = 1.076; // promptの数値
const delta = tension >= 1 ? 1 : -1;
const bracketPower =1.05;
let brasuu = 0;
while (!(bracketPower**(brasuu-1) * bracketPower ** 0.5 <= tension && tension < bracketPower**(brasuu) * bracketPower ** 0.5))　{ brasuu += delta; }
console.log(brasuu);
